(18, 49, '<!DOCTYPE html>\n<html lang=\"en\">\n<head>\n  <!-- Title -->\n  <title>Codician | Agile Software Development</title>\n\n  <!-- Required Meta Tags Always Come First -->\n  <meta charset=\"utf-8\">\n  <meta name=\"viewport\" content=\"width=device-width, initial-scale=1, shrink-to-fit=no\">\n  <meta name=\"Description\" CONTENT=\"Codician is a Custom Software Development Agency. We develop mobile and web applications for enterprises and startups on a fixed-price.\">\n\n  <!-- Favicon -->\n  <link rel=\"shortcut icon\" href=\"codician-favicon.ico\">\n\n  <!-- Font -->\n  <link href=\"https://fonts.googleapis.com/css?family=Open+Sans:400,600&display=swap\" rel=\"stylesheet\">\n\n  <!-- CSS Implementing Plugins -->\n  <link rel=\"stylesheet\" href=\"assets/vendor/font-awesome/css/all.min.css\">\n  <link rel=\"stylesheet\" href=\"assets/vendor/hs-mega-menu/dist/hs-mega-menu.min.css\">\n  <link rel=\"stylesheet\" href=\"assets/vendor/slick-carousel/slick/slick.css\">\n\n  <!-- CSS Front Template -->\n  <link rel=\"stylesheet\" href=\"assets/css/theme.css\">\n</head>\n<body>\n  <!-- ========== HEADER ========== -->\n    <header id=\"header\" class=\"header header-box-shadow-on-scroll header-abs-top header-bg-transparent header-show-hide\"\n          data-hs-header-options=\'{\n            \"fixMoment\": 1000,\n            \"fixEffect\": \"slide\"\n          }\'>\n\n    <div class=\"header-section\">\n     \n      <!-- End Topbar -->\n\n      <div id=\"logoAndNav\" class=\"container\">\n        <!-- Nav -->\n        <nav class=\"navbar sticky-top navbar-expand-lg\">\n          <!-- Logo -->\n          <a class=\"navbar-brand\" href=\"index.html\" aria-label=\"Front\">\n            <img src=\"codician-svg-logo-3.svg\" alt=\"Logo\" style=\"width: 200px;\">\n          </a>\n          <!-- End Logo -->\n\n          <!-- Responsive Toggle Button -->\n          <button type=\"button\" class=\"navbar-toggler btn btn-icon btn-sm rounded-circle\"\n                  aria-la