>\n      <div class=\"row mb-5 mb-md-9\">\n        <div class=\"col-sm-6 col-md-4 mb-3 mb-sm-7\">\n          <!-- Icon Block -->\n          <div class=\"media align-items-center mb-2\">\n            <figure class=\"w-100 max-w-6rem mr-3\">\n              <img class=\"img-fluid\" src=\"assets/svg/icons/icon-29.svg\" alt=\"SVG\">\n            </figure>\n            <div class=\"media-body\">\n              <h4 class=\"mb-0\">Understanding the Needs</h4>\n            </div>\n          </div>\n          <p>Our Development Team understands your needs before start the project. Brain-storming will help you to get most from your idea.</p>\n          <!-- End Icon Block -->\n        </div>\n\n        <div class=\"col-sm-6 col-md-4 mb-3 mb-sm-7\">\n          <!-- Icon Block -->\n          <div class=\"media align-items-center mb-2\">\n            <figure class=\"w-100 max-w-6rem mr-3\">\n              <img class=\"img-fluid\" src=\"assets/svg/icons/icon-44.svg\" alt=\"SVG\">\n            </figure>\n            <div class=\"media-body\">\n              <h4 class=\"mb-0\">Clean Coding</h4>\n            </div>\n          </div>\n          <p>Clean Coding is a very crucial phase to us. You will never encounter insurmountable technical debt that unclean code has brought you.</p>\n          <!-- End Icon Block -->\n        </div>\n\n        <div class=\"col-sm-6 col-md-4 mb-3 mb-sm-7 mb-md-0\">\n          <!-- Icon Block -->\n          <div class=\"media align-items-center mb-2\">\n            <figure class=\"w-100 max-w-6rem mr-3\">\n              <img class=\"img-fluid\" src=\"assets/svg/icons/icon-2.svg\" alt=\"SVG\">\n            </figure>\n            <div class=\"media-body\">\n              <h4 class=\"mb-0\">Requirement Analysis</h4>\n            </div>\n          </div>\n          <p>We make sure you will get what you thought for at the end of the project. We don\'t let undesirable outcomes make you give up.</p>\n          <!-- End Icon Block -->\n        </div>\n\n        <div class=\"col-sm-6 col-md-4 mb-3 mb-sm-7 mb-md-0\">\n          <!-- Icon Block -->\n          <div class=\"media align-items-center mb-2\">\n            <figure class=\"w-100 max-w-6rem mr-3\">\n              <img class=\"img-fluid\" src=\"assets/svg/icons/icon-37.svg\" alt=\"SVG\">\n            </figure>\n            <div class=\"media-body\">\n              <h4 class=\"mb-0\">Flawless Workflow</h4>\n            </div>\n          </div>\n          <p>You will be informed at each stage by your project advisor. You know exactly when the whole process will be completed.</p>\n          <!-- End Icon Block -->\n        </div>\n\n        <div class=\"col-sm-6 col-md-4 mb-3 mb-sm-7 mb-md-0\">\n          <!-- Icon Block -->\n          <div class=\"media align-items-center mb-2\">\n            <figure class=\"w-100 max-w-6rem mr-3\">\n              <img class=\"img-fluid\" src=\"assets/svg/icons/icon-5.svg\" alt=\"SVG\">\n            </figure>\n            <div class=\"media-body\">\n              <h4 class=\"mb-0\">Profit Ideas</h4>\n            </div>\n          </div>\n          <p>The profit model of the project is very crucial. We offer suggestions that can increase your income after the launch.</p>\n          <!-- End Icon Block -->\n        </div>\n\n        <div class=\"col-sm-6 col-md-4\">\n          <!-- Icon Block -->\n          <div class=\"media align-items-center mb-2\">\n            <figure class=\"w-100 max-w-6rem mr-3\">\n              <img class=\"img-fluid\" src=\"assets/svg/icons/icon-28.svg\" alt=\"SVG\">\n            </figure>\n            <div class=\"media-body\">\n              <h4 class=\"mb-0\">All-In-One Delivery</h4>\n            </div>\n          </div>\n          <p>At the end of the project, you receive a fully working software. We also support the installation processes.</p>\n          <!-- End Icon Block -->\n        </div>\n      \n      <!-- End Icon Blocks -->\n    </div>\n    <!-- End Features Section -->\n\n    <!-- Testimonials Se